window.onload = function() {
  console.log("Welcome to Haelin!");
  console.log("Commands:");
  console.log("[SPACE] toggle camera (3D or TIBIA)");
  console.log("[S , F] move left / right");
  console.log("[E , D] move forward / backward");
  console.log("[W , R] move up / down");
  console.log("[J , L] rotate left / right");
  console.log("[I , K] rotate up / ridown");
  console.log("[I , K] roll left / right");

  // Canvas
  var canvas = document.createElement("canvas");
  canvas.width = canvas.height = Math.min(window.innerWidth, window.innerHeight);
  //canvas.style.border = "1px solid #A0A0A0";
  document.body.style.backgroundColor = "black";
  document.getElementById("main").appendChild(canvas);
  document.body.style.display = "flex";
  document.body.style.alignItems = "center";
  document.body.style.justifyContent = "center";

  // Keyboard events
  var key = {};
  for (var i = 0; i < 255; ++i) { key[String.fromCharCode(i)] = 0; }
  document.body.onkeydown = (e) => key[e.key] = 1;
  document.body.onkeyup = (e) => key[e.key] = 0;
  document.body.onkeypress = (e) => { if (e.keyCode === 32) cam = init_cam(tibia_cam = !tibia_cam); /*console.log("cam.pos="+JSON.stringify(cam.pos)+"; cam.rot = "+JSON.stringify(cam.rot)+";")*/ };

  //var sprite_buffer = new Uint8Array(

  // Camera
  function init_cam(tibia_cam) {
    if (tibia_cam) {
      var cam = wlv.cam(wlv.TIBIA_CAM, [0, 0, 128], 128, [0, -1/Math.sqrt(3), -1]);
    } else {
      var cam = wlv.cam(wlv.PERSP_CAM, [0, 256, 256]);
      cam.rot = wlv.quat_mul(cam.rot, wlv.quat_rot_x(Math.PI * 0.75));
    }
    return cam;
  };
  var tibia_cam = true;
  var cam = init_cam(tibia_cam);
  var frame = 0;

  function render() {
    var time = Date.now() / 1000;

    // Camera
    if (tibia_cam) {
      cam.pos = wlv.vec_add(cam.pos, wlv.vec_scale([1,0,0], (key.f - key.s) * 3.0));
      cam.pos = wlv.vec_add(cam.pos, wlv.vec_scale([0,1,0], (key.d - key.e) * 3.0));
      cam.pos = wlv.vec_add(cam.pos, wlv.vec_scale([0,0,1], (key.r - key.w) * 3.0));
    } else {
      cam.rot = wlv.quat_mul(cam.rot, wlv.quat_rot_x((key.k - key.i) * Math.PI * 0.009));
      cam.rot = wlv.quat_mul(cam.rot, wlv.quat_rot_y((key.l - key.j) * Math.PI * 0.009));
      cam.rot = wlv.quat_mul(cam.rot, wlv.quat_rot_z((key.u - key.o) * Math.PI * 0.009));
      cam.pos = wlv.vec_add(cam.pos, wlv.vec_scale(wlv.cam_tox(cam), (key.f - key.s) * 8.0));
      cam.pos = wlv.vec_add(cam.pos, wlv.vec_scale(wlv.cam_toy(cam), (key.r - key.w) * 8.0));
      cam.pos = wlv.vec_add(cam.pos, wlv.vec_scale(wlv.cam_toz(cam), (key.e - key.d) * 8.0));
    }

    // Title
    document.title = JSON.stringify(cam.pos.map(x => Math.floor(x)));
    
    // Sprites
    function draw({sprite, light, sun, cam: set_cam}) {
      // Camera
      set_cam(cam);

      // Floor
      sprite({col: 0xFFFFFFFF, siz: [256 * 256 * 256 * 256, 256 * 256 * 256 * 256, 8], pos: [0, 0, -4]});

      // Main pillar / box
      sprite({loc: [ 0, 0, 64], siz: [24, 24, 24], pos: [160, 0, 12], vox: ([x,y,z]) => 0x0c0000ff});
      sprite({loc: [24, 0, 64], siz: [24, 24, 24], pos: [160, 0, 36], vox: ([x,y,z]) => 0x0c0000ff});
      sprite({loc: [48, 0, 64], siz: [24, 24, 24], pos: [160, 0, 58], vox: ([x,y,z]) => 0x0c00ff00});
      sprite({loc: [72, 0, 64], siz: [24, 24, 24], pos: [160, 0, 82], vox: ([x,y,z]) => 0x0c00ffff});

      // Pillars
      sprite({loc: [128, 128, 128+32], siz: [32, 32, 32], pos: [-64, -64, 32], vox: ([x,y,z]) => 0x030000FF});
      sprite({col: 0xFF606060, siz: [16, 16, 64], pos: [-64, -64, 32]});
      sprite({col: 0xFF606060, siz: [16, 16, 64], pos: [-64, +64, 32]});
      sprite({col: 0xFF606060, siz: [16, 16, 64], pos: [+64, -64, 32]});
      sprite({col: 0xFF606060, siz: [16, 16, 64], pos: [+64, +64, 32]});

      // Ball
      sprite({loc: [ 0,  64, 0], siz: [32, 32, 32], pos: [ 64,   0, 16], vox: ([x,y,z]) => (wlv.vec_dist([x,y,z], [16,16,16]) < 16 ? 0xFF0000FF : 0x00)});
      sprite({loc: [ 0, 128, 0], siz: [32, 32, 32], pos: [  0,  64, 16], vox: ([x,y,z]) => (wlv.vec_dist([x,y,z], [16,16,16]) < 16 ? 0xFF00FF00 : 0x00)});
      sprite({loc: [64,  64, 0], siz: [32, 32, 32], pos: [-64,   0, 16], vox: ([x,y,z]) => (wlv.vec_dist([x,y,z], [16,16,16]) < 16 ? 0xFFFF0000 : 0x00)});
      
      // Castle
      sprite({
        loc: [128, 128, 128],
        siz: [castle.size.x, castle.size.y, castle.size.z],
        pos: [0, 0, Math.ceil(castle.size.z / 2)],
        vox: ([x,y,z]) => castle.data[x + y * castle.size.x + z * castle.size.x * castle.size.y]
      });

      // Crazy ball
      sprite({loc: [128, 128, 0], siz: [32, 32, 32], pos: [ 0, -64, 16], vox: ([x,y,z]) => {
        var dist = wlv.vec_dist([x,y,z], [16,16,16]);
        var srad = 16;
        var r = 128 + Math.cos(time) * 64;
        var g = 128 + Math.cos(time * 12 + z) * 128;
        var b = 128 + Math.cos(time * 5 + y) * 64;
        var c = 0xFF000000 + (r << 0) + (g << 8) + (b << 16);
        return dist < srad ? c : 0x00;
      }});

      //sprite({loc: [128+32, 128+32, 128+32], siz: [32, 32, 32], pos: [0, 0, 64], gen: buffer => {
        //for (var z = 8; z < 24; ++z) {
          //for (var y = 8; y < 24; ++y) {
            //for (var x = 8; x < 24; ++x) {
              //buffer[x + y * 32 + z * 32 * 32] = 0xFF0000FF;
            //}
          //}
        //}
      //}});

      // Circling lights
      for (var i = 0; i < 1; ++i) {
        light({
          pos: [64 * Math.cos(time * (i + 1)), 64 * Math.sin(time * (i + 1)), 64],
          pow:  250
        });
      }

      // Blast light
      if (time % 12 > 8) {
        light({
          pos: [256, -128-64, 128],
          pow: 2 * 256 * 256 * (time % 12 > 10 ? 1 - (time % 12 - (12 - 2)) / 2 : 1)
        });
      }

      // Player light
      light({
        pos: [cam.pos[0], cam.pos[1], !tibia_cam ? cam.pos[2] : 32],
        pow: (!tibia_cam ? 100 : 0.1) * 1000
      });

      // Sun
      sun({dir: [Math.sqrt(3), Math.sqrt(3), Math.sqrt(3) * 4], pow: 0.0});
    };

    wlv.render({canvas, draw, debug: 1});
    window.requestAnimationFrame(render);
  }
  window.requestAnimationFrame(render);
}
